import React from 'react';
import Habit from './Habit';

const HabitList = ({ habits, deleteHabit, trackHabit }) => {
  return (
    <div>
      {habits.map((habit) => (
        <Habit
          key={habit.id}
          habit={habit}
          deleteHabit={deleteHabit}
          trackHabit={trackHabit}
        />
      ))}
    </div>
  );
};

export default HabitList;
